// src/nodes/MarkdownNode.js
import React from "react";
import BaseNode from "./BaseNode";

export default function MarkdownNode({ id, data }) {
  return (
    <BaseNode
      id={id}
      data={{
        title: "Markdown",
        subtitle: "render",
        inputs: [{ id: `${id}-md`, label: "md" }],
        outputs: [{ id: `${id}-html`, label: "html" }],
        children: <div>Converts markdown to HTML (demo).</div>,
      }}
    />
  );
}
